import React from "react";
import "./MovieRow.css";

export default ({ title, items }) => {
  return (
    <div>
      <h2>{title}</h2>
      <div className="movieRow--listarea">
        {items.results.length > 0 &&
          items.results.map((item, key) => (
            <img src={`htpps://image.tmdb.org/t/p/w300${item.logo_path}`} />
          ))}
      </div>
    </div>
  );
};
